// SPDX-License-Identifier: MIT
pragma solidity >=0.8.2 <0.9.0;

/**
 * @title Twitter
 * @dev Store & retrieve value in a variable
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */

contract TwitterTokio {


    struct Tweet {
        string username;
        string tweet;
        uint timestamp;
    }

    mapping(uint256 => Tweet) public tweets;
    uint256 public totalTweets;
    mapping(address => uint256) public ultimoMensajeLeido;


    event TweetPublicado(string indexed username, uint256 indexed tweetId, string tweet, uint256 timestamp);

    function setTweet(string memory _content, string memory _username) public {

        require(bytes(_content).length <= 300, "El mensaje supera la longitud maxima permitida");

        // Create a new Tweet
        tweets[totalTweets] = Tweet(_username, _content, block.timestamp);
        totalTweets++;
        emit TweetPublicado(_username, totalTweets - 1, _content, block.timestamp);
    }

    function actualizarUltimoMensajeLeido() internal {
        ultimoMensajeLeido[msg.sender] = totalTweets;
    }


    function getTweet(uint256 _desdeIndice) public view returns (Tweet[] memory) {
        require(_desdeIndice <= totalTweets, "Indice de inicio fuera de rango");

        uint256 numTweetsNoLeidos = totalTweets - _desdeIndice;

        Tweet[] memory listaTweets = new Tweet[](numTweetsNoLeidos);
        for (uint256 i = _desdeIndice; i < totalTweets; i++) {
            listaTweets[i - _desdeIndice] = tweets[i];
        }

        return listaTweets;
    }

    function obtenerUltimoMensajeLeido() public view returns (uint256) {
        return ultimoMensajeLeido[msg.sender];
    }

}

